import React from 'react';

function Menu(props) {
  return (
    <div className='container-fluid'>
      <div className='row'>
        <div className='col-12 menuBar'>
          <button className='menuBut' onClick={() => props.handleMenuClick('index')}>Home</button>
          <button className='menuBut' onClick={() => props.handleMenuClick('profile')}>Profile</button>
          <button className='menuBut' onClick={() => props.handleMenuClick('bookings')}>Bookings</button>
          <button className='menuBut' onClick={() => props.handleMenuClick('Classes')}>Classes</button>
          <button className='menuBut' onClick={() => props.handleMenuClick('createaccount')}>Create Account</button>
          <button className='menuBut' onClick={() => props.handleMenuClick('login')}>Log In</button>
        </div>
      </div>
    </div>
  );
}

export default Menu;
